import React from 'react'
import { Link } from 'react-router-dom';
function BankDetail() {
  return (
    <div>
      Select State
      <Link to='punjab' >Punjab</Link>
      <Link to='haryana' >Haryana</Link>
    </div>
  )
}

export default BankDetail
